import "./style.css";

function App() {
  return (
    <>
      <header className="header">
        <div className="logo">
          <img src="logo.png" height="90" width="180" alt="GaelGoal Logo" />
        </div>
      </header>

      <TeamFilter />
    </>
  );
}

function TeamFilter() {
  return <aside>Team Filter</aside>;
}

export default App;
